import React, { Component } from 'react'
import { Link } from "react-router-dom"
import "../config/fire"
import * as firebase from "firebase"

export default class Student extends Component {
    constructor(props) {
        super(props)

        this.state = {
            username: "",
            password: ""
        };
    };

    handlechange = (e) => {
        this.setState({
            username: e.target.value,
            password: e.target.value
        })
    }

    handlesubmit = (e) => {
        e.preventDefault()
        firebase.database()
            .ref("students")
            .push({
                username: this.state.username,
                password: this.state.password
            })
    }


    render() {
        return (

            <div>
                {/* <img src={Imga} width="100%" height="50%"/> */}

                <div className="cmd">

                    <label><h2>company login</h2></label>
                    <form onSubmit={this.handlesubmit}>
                        <input type="text" name="username" placeholder="Username" required onChange={this.handlechange} /><br />

                        <input type="password" name="password" placeholder="Password" required onChange={this.handlechange} /><br />

                        <input type="submit" value="Login"></input>
                    </form>

                </div>

                {/*just for testing  */}
                <div>
                <Link to="/company/companyprofile" className="sbtn">
                     <button className="sbtn">company profile</button>
                 </Link>
                </div>

            </div>

        )
    }
}
